import {BrowserRouter, Routes, Route} from "react-router-dom";
import UserList from "./components/UserList";

function App() {
  return (
    <BrowserRouter>
    <Route>
      <Route path="/" element={<UserList/>}/>
      <Route path="add" element={<UserList/>}/>
    </Route>
      <UserList/>
    </BrowserRouter>
  );
}

export default App;
